import React, { Component } from 'react';
import Axios from 'axios';

export default class App extends Component {
    constructor(){
        super();
        this.state = {
            indexData: []
        }
    }

    componentDidMount() {
        Axios.get('http://localhost:8080/').then(
            res => {
                this.setState({indexData:res.data});
            }
        ).catch(err => {
            console.log(err);
        });
    }

    render() {
        return (
            <div>
                {this.state.indexData.map(
                    res => <p>{res.id}</p>
                )}
            </div>
        );
    }
}
